import React, { useEffect, useState } from "react";
import Papa from "papaparse";
import SearchBar from "../components/SearchBar";
import TrashIcon from "../components/TrashIcon";
import Modal from "../components/Modal";
import { Button } from "../components/ui/button";
import { Card, CardContent } from "../components/ui/card";
import Header from "../components/Header"; // âœ… Add this

const NewQuote = () => {
  const [items, setItems] = useState([]);
  const [quoteItems, setQuoteItems] = useState([]);
  const [searchTerm, setSearchTerm] = useState("");
  const [customerList, setCustomerList] = useState([]);
  const [eventList, setEventList] = useState([]);
  const [event, setEvent] = useState("");
  const [date, setDate] = useState(new Date().toISOString().split("T")[0]);
  const [customer, setCustomer] = useState({
    name: "",
    phone: "",
    address1: "",
    address2: "",
    city: "",
    state: "",
    zip: "",
    email: "",
    contactFirstName: "",
    contactLastName: "",
  });
  const [showModal, setShowModal] = useState(false);

  const handleQuantityChange = (index, value) => {
    const updated = [...quoteItems];
    updated[index].quantity = parseInt(value) || 0;
    setQuoteItems(updated);
  };

  const handlePriceChange = (index, value) => {
    const updated = [...quoteItems];
    updated[index].price = parseFloat(value) || 0;
    setQuoteItems(updated);
  };

  const removeItem = (index) => {
    const updated = [...quoteItems];
    updated.splice(index, 1);
    setQuoteItems(updated);
  };

  const clearQuote = () => {
    setShowModal(true);
  };

  const confirmClear = () => {
    setQuoteItems([]);
    setShowModal(false);
  };

  return (
    <div className="min-h-screen bg-gray-100">
      <Header title="New Quote" user={{ email: "sales@gvws.com" }} />

      <div className="max-w-7xl mx-auto p-6">
        <Card className="mb-6">
          <CardContent className="p-4 space-y-4">
            <div className="font-semibold text-lg">Customer Info</div>
            {/* Customer fields here */}
            <input
              type="text"
              placeholder="Customer Name"
              value={customer.name}
              onChange={(e) => setCustomer({ ...customer, name: e.target.value })}
              className="w-full border rounded px-3 py-2"
            />
          </CardContent>
        </Card>

        <div className="grid grid-cols-2 gap-6">
          {/* Item Search */}
          <Card className="h-[500px] overflow-y-auto">
            <CardContent className="p-4 space-y-4">
              <div className="font-semibold mb-2">Item Search</div>
              <SearchBar items={items} setFiltered={setItems} searchTerm={searchTerm} setSearchTerm={setSearchTerm} />
              {/* Add item preview or filtered results here */}
            </CardContent>
          </Card>

          {/* Quote Items */}
          <Card className="h-[500px] flex flex-col">
            <CardContent className="p-4 flex flex-col flex-grow">
              <div className="font-semibold mb-2">Items in Quote</div>

              {/* Table headers */}
              <div className="grid grid-cols-5 gap-2 text-sm font-semibold text-gray-600 border-b pb-2 mb-2">
                <div>Item</div>
                <div>Qty</div>
                <div>Price</div>
                <div>Total</div>
                <div>Remove</div>
              </div>

              {/* Scrollable items */}
              <div className="flex-grow overflow-y-auto space-y-2">
                {quoteItems.map((item, index) => (
                  <div key={index} className="grid grid-cols-5 gap-2 items-center">
                    <div className="font-medium">{item.name}</div>

                    <input
                      type="text"
                      inputMode="numeric"
                      pattern="[0-9]*"
                      value={item.quantity}
                      onChange={(e) => handleQuantityChange(index, e.target.value)}
                      className="border rounded-md px-2 py-1 text-center"
                    />

                    <input
                      type="text"
                      inputMode="decimal"
                      pattern="^\d+(\.\d{0,2})?$"
                      value={item.price}
                      onChange={(e) => handlePriceChange(index, e.target.value)}
                      className="border rounded-md px-2 py-1 text-center"
                    />

                    <div className="text-right pr-2">
                      ${(item.quantity * item.price).toFixed(2)}
                    </div>

                    <button onClick={() => removeItem(index)}>
                      <TrashIcon />
                    </button>
                  </div>
                ))}
              </div>

              {/* Buttons */}
              <div className="pt-4 mt-4 border-t flex justify-end space-x-4">
                <Button variant="outline" onClick={clearQuote}>
                  Clear Quote
                </Button>
                <Button onClick={() => alert("Save logic here")}>Save Quote</Button>
              </div>
            </CardContent>
          </Card>
        </div>
      </div>

      {/* Confirm Clear Modal */}
      <Modal isOpen={showModal} onClose={() => setShowModal(false)} onConfirm={confirmClear}>
        <p>Are you sure you want to clear the quote? All unsaved data will be lost.</p>
      </Modal>
    </div>
  );
};

export default NewQuote;
